configs – configuration files options configs[name: string].overwrite: boolean – forcily rewrite file without merge and caching. Example: { "configs": { ".eslintrc": { "overwrite": true } }
} .eslintrc will be always equal to upcoming one. configs[name: string].format: boolean – enables or disables formatting with prettier or editorconfig. Example: { "configs": { ".eslintrc": { "format": false } }
} .eslintrc will not be formatted.

7.body:
--silent, -s - hides all outputs from sharec in CLI. Example: { "scripts": { "postinstall": "sharec --silent" }
} --overwrite, -o - force sharec to replace all configs without merging and caching. Example: { "scripts": { "postinstall": "sharec --overwrite" }
} --disappear, -d - installs configuration without meta injecting and caching, like you do that by yourself. Example: { "scripts": { "postinstall": "sharec --disappear" }
} --interactive, -i - interactive mode in which sharec asks user before merge any config. Example: { "scripts": { "postinstall": "sharec --interactive" }
} --include-cache, -c - saves configuration cache in target project directory. It is very usefull, if you want always have ability to change configuration version in project without any problems. With this option, cache would be saved in <project_path>/.sharec/.cache, instead node_modules. Especially this feature can be usefull if you are using package manager which do not make node_modules. Be sure, if you use this option, that .sharec directory is not ignored by git! Example: { "scripts": { "postinstall": "sharec --include-cache" }
}
